import React from 'react';
import UserInput from './Components/UserInput';
import { Routes,Route } from 'react-router-dom';

const Home = () => {
  return (
    <>
      <h1>home</h1>
      <Routes>
      <Route path="/userinput" element={<UserInput/>} />
</Routes>

    </>
  );
}

export default Home;
